import React from 'react'
import { useNavigate } from 'react-router-dom';

function Home() {
	const navigate = useNavigate();

  const handleNavigate = () => {
    navigate('/', { replace: true });
  };

  return (
    <button onClick={handleNavigate}>
      Go to Home Page
    </button>
  );

};

export default Home;
